import React from 'react';
// import Item from './Item'
// import './ItemsList.css';

class ItemsList extends React.Component {

	render () {
		return (
			<div>
				<table className="w3-table w3-bordered">
					<thead>
						<tr className="w3-green">
							<th>Name</th>
							<th>Date</th>
							<th>Hour</th>
							<th>Actions</th>
						</tr>
					</thead>
					<tbody>
						{this.props.items}
					</tbody>
				</table>
			</div>
		);
	}

}

export default ItemsList;
